import React from 'react'
import BasePage from '../pages/BasePages/BasePage.js';
import Search from '../components/ProfileBlocks/Search/Search'
import ProfileBlocksSecretary from '../components/ProfileBlocks/Secretary/ProfileBlocksSecretary/ProfileBlocksSecretary'



function ProfileSecretary({secretaryData, tableData}) {
  return (
      <BasePage isAuthenticated={true} data={secretaryData}>
        <Search />
        <ProfileBlocksSecretary secretaryData={secretaryData} tableData={tableData}/>
        </BasePage>
  
  )
}

export default ProfileSecretary
